import { Component, useEffect } from "react";

function GetServers() {
    const [serverList, setServerList] = useState();
    useEffect(() => {
      async function getToken() {
        const response = await fetch('https://playground.oxylabs.io/api/user/login', {
           method: 'POST',
           headers: { "Content-Type": 'application/json' },
           body: JSON.stringify({
             "username": "oxylabs",
             "password": "partyanimal",
           })
         });

         const data = await response.json();

         return data.token;
      }

      async function getServerList(token) {
        const response = await fetch('https://playground.oxylabs.io/api/servers', {
           method: 'GET',
           headers: {
             "Content-Type": 'application/json',
             "x-access-token": token,
           },
         });

        const data = await response.json();

        return data;
      }

      async function run() {
        const token = await getToken();
        const serverList = await getServerList(token);
        console.log(serverList[0].name);
        this.setState({
          servers: serverList,
        });
      }

      run();
    })




    const {servers} = this.state
    return (
        <div className="GetServers">{servers[0].name}</div>
    )
}

export default GetServers;
